import  "./ahc1.css"

export default function Ahc1() {
  return (
    <div >
      <h3 className="title">The surprising power of Atomic Habits</h3>
      <ul>
        <li>We all deal with setbacks but  in the long run the quality of our lives depends on the quality of our habits</li>
        <li>Being a little bit nicer in each interaction can lead to a network of strong and broad connections overtime</li>
      </ul>
    </div>
  )
}
